import './App.css';
import Board from './Components/Board';

function App() {

  const boardSize = 990;

  // Values to Generate Random Positions:
  const valuex = Math.floor(Math.random() * boardSize);
  const valuey = Math.floor(Math.random() * boardSize);
  const randomvalue = Math.floor(Math.random() * boardSize);

  // Add Images to generate in specified coordinates:
  const pieces = [];
  pieces.push({image: "assets/images/robot-preview.png", x: valuex, y: valuey});
  pieces.push({image: "assets/images/b_pawn.png", x: Math.floor((boardSize/2)-1), y: Math.floor((boardSize/2)+2)});
  pieces.push({image: "assets/images/cake.png", x: Math.floor(boardSize/2), y: Math.floor(boardSize/2)});
  pieces.push({image: "assets/images/chair.png", x: Math.floor((boardSize/2)+1), y: Math.floor((boardSize/2)+1)});
  pieces.push({image: "assets/images/link.png", x: randomvalue, y: randomvalue});

  return (
    <div id="App">
      <Board pieces={pieces}/>
    </div>
  );
}

export default App;
